import React from "react";

const container = props => {
    const styles = {
        width: "100%", 
        maxWidth: "45rem", 
        //height: "28rem",
        margin: "auto",
        top: "0px",
        left: "0px",
        right: "0px",
        bottom: "0px",
        position: "absolute"
    };
    return (
        <div className="jumbotron" style={styles}>
            {props.children}
        </div>
    );
};

export default container;
